import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-liaison-bidir',
  templateUrl: './liaison-bidir.component.html',
  styleUrls: ['./liaison-bidir.component.css']
})
export class LiaisonBidirComponent implements OnInit{
  public texte!: string

  ngOnInit(): void {
    // initialisation de texte
    this.texte = ''

  }

}
<div class="green-border">
  <p>liaison-bidir works!</p>
  <input type="text" [(ngModel)]="texte" [value]="texte" style="max-width: 300px">

  <p>{{ texte }}</p>

</div>
